import React from "react";
import ToDoLists from "./ToDoLists";
import {connect} from "react-redux";
import {withRouter} from "react-router-dom";
import {getToDoLists} from "../../Redux/todoListReducer";

class ToDoListsContainer extends React.Component {

    componentDidMount() {
    }

    render() {
        return <ToDoLists {...this.props}/>

    }

}

const mapStateToProps = (state) => ({
    toDoLists: state.todoList.toDoLists,
    tasksLists: state.todoList.tasksLists,
});

let WithRouterHeaderComponent = withRouter(ToDoListsContainer)

export default connect(mapStateToProps, { getToDoLists})(WithRouterHeaderComponent)
